              </div>
            </div>
            <div className={css.orderBox}>
              <div className={css.orderSubtitle}>Quantity</div>
              {/* <div className={css.orderTitle}>{quantity}</div> */}
            </div>
            <div className={css.orderBox}>
              <div className={css.orderSubtitle}>Method</div>
