            </div>
            <div className={css.orderBox}>
              <div className={css.orderSubtitle}>Email</div>
              {/* <div className={css.orderTitle}>{userEmail}</div> */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default OrderConfirmation;
